import axios from "axios";

const API_BASE = process.env.REACT_APP_API_URL || "http://localhost:5000/api";

export const getFeedbacks = () => axios.get(`${API_BASE}/feedbacks`);
export const addFeedback = (data) => axios.post(`${API_BASE}/feedbacks`, data);
export const updateFeedback = (id, data) => axios.put(`${API_BASE}/feedbacks/${id}`, data);
export const deleteFeedback = (id) => axios.delete(`${API_BASE}/feedbacks/${id}`);
